import React, { Component } from 'react'
import $ from 'jquery'
import './works.css'
import image1 from '../../Images/image1.jpg'
import image2 from '../../Images/image2.jpg'
import image3 from '../../Images/image3.jpg'
import image4 from '../../Images/image4.jpg'
import image5 from '../../Images/image5.jpg'
import image6 from '../../Images/image6.jpg'
import image8 from '../../Images/image8.jpg'
import image9 from '../../Images/image9.jpg'
import image10 from '../../Images/image10.jpg'

class Works extends Component{
    componentDidMount = () =>{
        $(document).ready(function(){
            $(".button").click(function(){
                var name = $(this).attr("data-filter");
                if(name == "all"){
                    $(".filter").show("2000");
                }
                else{
                    $(".filter").not("."+name).hide("2000");
                    $(".filter").filter("."+name).show("2000");
                }
            });
        });
    }


    render() {
        return(
            <div className="latest-work">
                    <h1 className="work-text1">Latest Works</h1>
                    <div className="navigation">
                        <a href="#" data-filter="all" class="button active">ALL</a>
                        <a href="#" data-filter="one" class="button">One</a>
                        <a href="#" data-filter="two" class="button">two</a>
                        <a href="#" data-filter="Three" class="button">Three</a>
                    </div>
                    <div className="ImageContainer">
                        <div className="filter one">
                            <img src={image1} />
                        </div>
                        <div className="filter one">
                            <img src={image2} />
                        </div>
                        <div className="filter two">
                            <img src={image3} />
                        </div>
                        <div className="filter two">
                            <img src={image4} />
                        </div>
                        <div className="filter two">
                            <img src={image5} />
                        </div>
                        <div className="filter Three">
                            <img src={image6} />
                        </div>
                        <div className="filter Three">
                            <img src={image8} />
                        </div>
                        <div className="filter Three">
                            <img src={image9} />
                        </div>
                        <div className="filter Three">
                            <img src={image10} />
                        </div>


                    </div>
            </div>
        );
    }
}

export default Works;
